var tipuesearch = {"pages": [{'title': '關於', 'text': '網頁： https://mdewcm2024.github.io/1a-ag6/content/index.html \n 網誌：請填寫目前網站所在的URL/blog，https:  //mde.tw/cmsimde_site/blog \n 簡報: 請填寫目前網站所在的 URL/reveal,  https://mde.tw/cmsimde_site/reveal \n 對應以太坊：請填寫目前網站所的Github連結以太坊 \n 本cmsimde網際內容管理系統的範本應答： \n https://github.com/mdecycu/cmsimde_site \n 此範本將cmsimde作為子目錄硬體子模組，使用者可依需求自行修改 \n 對應以太坊網站： https:  //mde.tw/cmsimde_site \n', 'tags': '', 'url': '關於.html'}, {'title': '公分西德', 'text': "SMap  - 網站地圖 - 依序排列網站的所有頁面。 \n EditA  - 編輯所有頁面 - 將所有頁面放入編輯模式中，主要用於處理頁面遷移、刪除或決定衝突頁面內容版本。 \n 編輯 -編輯頁面-先選擇要編輯的單一頁面後，再點選編輯，即可進入單一頁面的編輯模式。 \n 設定 - 設定網站 - 編輯頁面標題與管理員密碼。 \n 搜尋 - 動態頁面內容的關鍵字搜尋。 \n IUpload  - 圖片檔案上傳 - 圖檔的上傳功能，可以上傳jpg、png和gif文件，其中若在手機上傳圖文件，系統會自動將圖片檔案縮小為800x800大小。 \n IList  - 圖片檔案清單 - 上市可以直接在頁面編輯模式中引用的圖片檔案。 \n FUpload  - 檔案上傳 - 一般檔案的上傳功能，目前可以上傳的檔案副檔名包括 'jpg', 'png', 'gif', '7z', 'pdf', 'zip', 'ttt', 'stl '、'txt'、'html'、'mp4'等，使用者可以自行修改。 \n FList  - 文件清單 - 上市可以直接在頁面編輯模式中引用的上傳文件。 \n 登出 -登出頁面編輯模式。 \n 轉換 - 將動態網站中位於 config/content.htm 文件，透過分頁設定轉為內容目錄中的靜態網頁。 \n acp  - git add、git commit 和 git Push，通常只能在 localhost 或自架主機上網頁表單協助將以太坊改版內容推送到 Github 使用。 \n SStatic  - 啟動靜態網站 - 利用Python啟動網站伺服器功能，可以讓使用者檢查轉檔後的靜態網站內容。 \n RStatic  - Replit 靜態網站 URL - 僅用於 Replit 模式，當使用者點擊 SStatic 後，可以點擊 RStatic 進入尚未推向 Github Pages 的靜態網站。 \n 80  - 由 init.py 中 static_port 決定的連結字符串，一般不使用 80，僅在 Replit 中為了與動態網站佔用端口，才特別設為 80。 \n \n", 'tags': '', 'url': '公分西德.html'}, {'title': 'w6', 'text': '', 'tags': '', 'url': 'w6.html'}, {'title': '雷普利特', 'text': 'https://replit.com \n 利用 init_replit 指令安裝所需 Python 模組 chmod u+x init_replit  ./init_replit \n 複製時： \n .replit：python3 main.py \n chmod u+x cms init_replit \n ./init_replit \n 對於 cmsimde_site （不需要）： git submodule update --init --recursive \n 對於 cmsimde：pip installflaskflask_corsbs4lxmlpelicanmarkdowngevent \n 密碼產生器：\xa0 https:  //mde.tw/cmsite/content/Brython.html ?src=https://gist.githubusercontent.com/mdecycu/b92b16621dd0246c352cf13d6463b333/raw/0bfa66975033b669750 .py \xa0 \n \n 僅適用於 IPv6 Ubuntu： .ssh 目錄中的配置，將 SSH 會話名稱設為 github.com： 主機 github.com 使用者 git 主機名稱 github.com  ProxyCommand /usr/bin/ncat --proxy p4.cycu.org: 3128 - -proxy-type http %h %p  for Replit:  .ssh 目錄中的配置，將 SSH 會話名稱設為 github.com: 主機 github.com 用戶 git 主機名 github.co  #since Replit 適用於IPv4，因此沒有ProxyCommand 設定需要 #ProxyCommand /usr/bin/ncat --proxy p4.cycu.org:3128 --proxy-type http %h %p \n \n \n', 'tags': '', 'url': '雷普利特.html'}, {'title': '布萊頓', 'text': "https://en.wikipedia.org/wiki/Python_（程式語言） \n 例子： \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python教學： \n https://docs.python.org/3/tutorial/ \n Python 的非正式介紹 \n 縮排（Python 採用 4 個 Spaces 縮排，以介面執行範圍） \n 變數（ Python 關鍵字 ） \n 註（#單行註解、三單標註或三雙標註標註多行註解） \n 數 (整數 int(), 浮點數 float()) \n 字串 （字符串） \n print (Python 內建函數,  print() 函式) \n Python是控制流程工具 \n 為了 \n 如果 \n 範圍 \n 打開 \n 讀 \n 清單 \n 元組 \n 字典 \n 功能 \n 嘗試...除了 \n 休息 \n 經過 \n 類別 \n 此頁面示範如何在同一頁面下納入多個線上Ace編輯器與執行按鈕（ practice_html.txt 動態頁面超檔案）。 \n Practice_html.txt 動態頁面超檔案應該可以在啟動 Brython 時，設定會將 .py 檔案放入 downloads/py 目錄中引用。 \n 也即將所有對應的 html 也使用 Brython 產生，然後編寫為 類別 後，在範例匯入時透過 實例 引用。 \n <!-- 啟動 Brython --> \n<腳本> \n視窗.onload=函數(){ \nbrython({debug:1, pythonpath:['./../cmsimde/static/','./../downloads/py/']}); \n} \n</腳本> \n 從1累加到100： \n", 'tags': '', 'url': '布萊頓.html'}, {'title': '期末報告', 'text': '', 'tags': '', 'url': '期末報告.html'}, {'title': '遊戲', 'text': '', 'tags': '', 'url': '遊戲.html'}, {'title': '塔羅牌', 'text': '首先，確保您有一組塔羅牌的圖像文件，把它們儲存在一個名為「tarot_cards」的資料夾中。 \n pip install Pillow \n 接下來，您可以使用以下Python代碼來創建一個簡單的塔羅牌應用程序 \n import os\nimport random\nfrom PIL import Image\n\n# 塔羅牌圖像文件夾\nTAROT_FOLDER = "tarot_cards"\n\n# 獲取所有塔羅牌圖像的文件名\ntarot_cards = os.listdir(TAROT_FOLDER)\n\n# 隨機選擇一張塔羅牌\nselected_card = random.choice(tarot_cards)\n\n# 打印所選塔羅牌的名稱\nprint("你的塔羅牌是：" + selected_card)\n\n# 顯示所選塔羅牌的圖像\nimage_path = os.path.join(TAROT_FOLDER, selected_card)\nimage = Image.open(image_path)\nimage.show() \n 這個代碼將隨機選擇一張塔羅牌，並顯示其圖像。請確保您有一個名為"tarot_cards"的文件夾，其中包含塔羅牌圖像。這個示例僅供參考，您可以根據需要進一步擴展和自定義這個塔羅牌應用程序。 \n', 'tags': '', 'url': '塔羅牌.html'}, {'title': '德州撲克', 'text': 'import random\n\n# 定義撲克牌的花色和點數\nsuits = [\'Hearts\', \'Diamonds\', \'Clubs\', \'Spades\']\nranks = [\'Two\', \'Three\', \'Four\', \'Five\', \'Six\', \'Seven\', \'Eight\', \'Nine\', \'Ten\', \'Jack\', \'Queen\', \'King\', \'Ace\']\n\n# 初始化一副撲克牌\ndeck = [{\'rank\': rank, \'suit\': suit} for rank in ranks for suit in suits]\n\n# 洗牌\nrandom.shuffle(deck)\n\n# 發兩張牌給玩家和莊家\nplayer_hand = [deck.pop(), deck.pop()]\ndealer_hand = [deck.pop(), deck.pop()]\n\n# 顯示玩家的牌和一張莊家的牌\nprint(f\'玩家的牌: {player_hand[0]["rank"]} of {player_hand[0]["suit"]} 和 {player_hand[1]["rank"]} of {player_hand[1]["suit"]}\')\nprint(f\'莊家的牌: {dealer_hand[0]["rank"]} of {dealer_hand[0]["suit"]} 和 一張未知牌\')\n\n# 檢查是否有玩家或莊家已經有21點（Blackjack）\ndef blackjack(hand):\n    values = [card_value(card) for card in hand]\n    return sum(values) == 21\n\n# 計算牌的點數\ndef card_value(card):\n    if card[\'rank\'] in [\'Jack\', \'Queen\', \'King\']:\n        return 10\n    elif card[\'rank\'] == \'Ace\':\n        return 11\n    else:\n        return int(card[\'rank\'])\n\n# 主遊戲迴圈\nwhile True:\n    # 檢查是否有玩家或莊家已經有21點\n    if blackjack(player_hand) or blackjack(dealer_hand):\n        break\n\n    # 玩家選擇要加牌還是停止\n    action = input(\'要加牌嗎？（加牌/停止）: \')\n    if action.lower() == \'加牌\':\n        player_hand.append(deck.pop())\n        print(f\'你的牌: {", ".join([card["rank"] + " of " + card["suit"] for card in player_hand])}\')\n    else:\n        break\n\n# 莊家加牌直到達到17點或更高\nwhile sum([card_value(card) for card in dealer_hand]) < 17:\n    dealer_hand.append(deck.pop())\n\n# 顯示最終結果\nprint(f\'你的牌: {", ".join([card["rank"] + " of " + card["suit"] for card in player_hand])}\')\nprint(f\'你的點數: {sum([card_value(card) for card in player_hand])}\')\nprint(f\'莊家的牌: {", ".join([card["rank"] + " of " + card["suit"] for card in dealer_hand])}\')\nprint(f\'莊家的點數: {sum([card_value(card) for card in dealer_hand])}\')\n\n# 判斷贏家\nif sum([card_value(card) for card in player_hand]) > 21:\n    print(\'你爆牌了，莊家贏了！\')\nelif sum([card_value(card) for card in dealer_hand]) > 21:\n    print(\'莊家爆牌了，你贏了！\')\nelif sum([card_value(card) for card in player_hand]) > sum([card_value(card) for card in dealer_hand]):\n    print(\'你贏了！\')\nelif sum([card_value(card) for card in player_hand]) < sum([card_value(card) for card in dealer_hand]):\n    print(\'莊家贏了！\')\nelse:\n    print(\'平局！\')\n \n 在執行上面的代碼後，你將開始一個簡單的德州撲克遊戲。遊戲的進行方式如下： \n \n \n 執行代碼：在你的 Python 開發環境中運行上面提供的代碼。這樣你就會看到一副洗好的撲克牌和玩家、莊家的初始牌。 \n \n \n 玩家回合：遊戲將提示你進行選擇。你可以輸入"加牌"以繼續要求加牌，或者輸入"停止"以結束你的回合。 \n \n \n 莊家回合：當你選擇"停止"或者當你的牌總和達到21點時，莊家將開始自己的回合，自動加牌直到達到17點或更高。 \n \n \n 結算：遊戲將計算玩家和莊家的點數，並確定勝利者。結果將被輸出到屏幕上，以宣布遊戲的結果。 \n \n \n \n \n \n \n \n \n 1 加到 100 \n 將 iterable 與 iterator 相關說明 ，利用 Brython 與 Ace Editor 整理在此頁面。 \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n \n \n \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n \n \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n 檔案名稱： .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n 跑步   輸出   明確輸出區 清晰的繪圖區 重新載入 \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從1累加到100第2部分： \n 1 加到 100 cango_三_齒輪 BS蛇 人工智慧俄羅斯方塊 旋轉塊 \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n 檔案名稱： .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n 跑步   輸出   明確輸出區 清晰的繪圖區 重新載入 \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n \n', 'tags': '', 'url': '德州撲克.html'}]};